import styled from 'styled-components/native';

export const Container = styled.View`
width: 100%;
height: 100%;
align-items: center;
justify-content: center;
`;

export const PurpleBar = styled.View`
position: absolute;
top: 0;
background-color: #677689;
width: 100%;
height: 5%;
`;

export const PurpleCircle = styled.View`
position: absolute;
background-color: #677689;
top: 220px;
width: 150%;
height: 100%;
border-radius: 300px;
}
`;

export const Smartmobile = styled.Text`
position: absolute;
color: #677689;
font-size: 40px;
top: 100px;
`;

export const Inputs = styled.View`
position: absolute;
width: 100%;
height: 100%;
}
`;

export const Input = styled.TextInput` 
background-color: #dbdbdb;
color: #677689;
width: 90%;
height: 50px;
margin-bottom: 15px;
`;
